import{_ as e,o as r,c as a,O as t}from"./chunks/framework.9482e208.js";const _=JSON.parse('{"title":"§ 33.2-1210 Duration and renewal of permit.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/33.2-1210.md","filePath":"vacode/33.2-1210.md"}'),i={name:"vacode/33.2-1210.md"},n=t('<h1 id="§-33-2-1210-duration-and-renewal-of-permit" tabindex="-1">§ 33.2-1210 Duration and renewal of permit. <a class="header-anchor" href="#§-33-2-1210-duration-and-renewal-of-permit" aria-label="Permalink to &quot;§ 33.2-1210 Duration and renewal of permit.&quot;">​</a></h1><p>Except as provided in § <a href="http://law.lis.virginia.gov/vacode/33.2-1212/" target="_blank" rel="noreferrer">33.2-1212</a>, permits issued in accordance with this article shall run for the calendar year and may be renewed upon application made upon forms furnished by the Commissioner of Highways and the payment of the same fee required to be paid upon application for a permit. Fees for renewal of permits using the Department&#39;s electronic application renewal process shall be reduced by $5 per permit being renewed. Permits shall not be extended or renewed in cases where the permittee has not exercised the privilege of erecting such advertising structure or displayed such advertisement during the period for which the permit was issued. Annual permits issued after December 15 shall cover the following calendar year.</p><p>Code 1950, § 33-309; 1954, c. 588; 1970, c. 322, § 33.1-362; 2012, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?121+ful+CHAP0145" target="_blank" rel="noreferrer">145</a>; 2014, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?141+ful+CHAP0805" target="_blank" rel="noreferrer">805</a>.</p>',3),o=[n];function s(d,c,l,p,h,f){return r(),a("div",null,o)}const u=e(i,[["render",s]]);export{_ as __pageData,u as default};
